import './App.css';
import LoginButton from './compontents/LoginButton';
import LogoutButton from './compontents/LogoutButton';
import SignupForm from './compontents/SignupForm';
import SignupButton from './compontents/SingupButton';


function App() {



  return (
    <div className="App">
      <div>
        <SignupForm />
        <SignupButton />
        <LoginButton />
        <LogoutButton />
      </div>
    </div>
  );
}

export default App;
